import React from 'react';
import { useParams } from 'react-router-dom';
import carListings from './carListings'; // Import the listings data (can be passed down via props if using external data source)

const CarDetailPage = () => {
  const { id } = useParams(); // Get the car id from the URL
  const car = carListings.find(car => car.id === parseInt(id)); // Find the car based on the id

  if (!car) {
    return <div>Car not found</div>;
  }

  return (
    <div className="car-detail-page">
      <h2>{car.manufacturer} {car.model} - {car.year}</h2>
      <img src={car.imgSrc} alt={car.model} />
      <div className="car-info">
        <p><strong>Price:</strong> ${car.price}</p>
        <p><strong>Kilometers:</strong> {car.kilometers} km</p>
        <p><strong>Fuel Type:</strong> {car.fuel}</p>
        <p><strong>Drive Type:</strong> {car.driveType}</p>
        <p><strong>Transmission:</strong> {car.transmission}</p>
        <p><strong>Horsepower:</strong> {car.horsepower} HP</p>
        <button>Contact Seller</button>
        {/* Add more details as needed */}
      </div>
    </div>
  );
};

export default CarDetailPage;
